const RestaurantListItem = ({ name, address, cuisines, type }) => {
  return (
    <li>
      <h3>
        {name} | {type}
      </h3>
      <p>{address}</p>
      <ul>
        {cuisines.map((cuisine) => (
          <li key={cuisine.id}>{cuisine.name}</li>
        ))}
      </ul>
    </li>
  );
};

export default RestaurantListItem;
